            //         height: "200px",
            //         width: "100%",
            //         backgroundRepeat: "no-repeat",
            //         backgroundSize: "cover",
            //       })
            //     );
            //   }}
          />
        </Card.Body>

        <Card.Footer></Card.Footer>
      </Card>
    </>
  );
}

export default Trip;
